import React, { onnAdd, useState } from "react";
import { Container, Row, Col, Card, Button } from "react-bootstrap";

function Cotalog(props) {
  const { product, onAdd } = props;
  <Container>
    <Row>
      <Col xs={9}>
        <Row>
          {products.map((product) => (
            <Col sm={12} md={6} lg={4} xl={4} className="d-flex">
              <Card className="mb-3">
                <Card.Img
                  variant="top"
                  src={product.image}
                  className="auto-img"
                />
                <Card.Body className="auto-body">
                  <Card.Title>
                    key={product.id} {product.name}
                  </Card.Title>
                  <Card.Text className="d-flex justify-content-between align-items-centr">
                    {product.description}
                  </Card.Text>
                  <Button
                    className="justify-content-between"
                    variant="dark"
                    onClick={() => onAdd(product)}
                  >
                    Купить <span>{price.id} РУБ.</span>
                  </Button>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Col>
    </Row>
  </Container>;
}

export default Catalog;
